import React from 'react';

const IterationSample = () => {
  const names = ['Snowman', 'Ice', 'Snow', 'Wind'];
  const nameList = names.map(name => <li>{name}</li>);
  return <ul>{nameList}</ul>;
};

export default IterationSample;
